body:
Empty object is passed to StatelessComponent even if we pass no props.
Example:

``` js
function Test(props) {
  return <div>props: {JSON.stringify(props)}</div>
}

React.render(<Test />, document.body)
```

will render into `props: {}`
[jsfiddle](https://jsfiddle.net/LL25c28c/)

We need to fix this because otherwise we have error:
`Property 'propName' does not exist on type 'IntrinsicAttributes & (IMyInterface | undefined)'.`
for that code:

``` js
const MyComponent: React.SFC<IMyInterface> = ({ propName }: IMyInterface) => {
  // ...
}
```

Noticed this for the "process" from node, and looked for other instances.
In some cases this is due to behavior where in:

```
/** This section declares `x` and `y`. */

/** Variable x. */
const x = 0;
/** Variable y. */
const y = 0;
```

when hovering over `x`, we see text extracted from both comments above it.

**EDIT**: Also, all doc comments starting with `/***` are a problem because we currently parse the contents as containing a first line whose content is `*`. We could fix that by changing all `/***` to `/**`, or by changing the compiler to skip all leading `*`, no matter how many of them there are.

There is a similar problem with trailing `*` showing up, and with `/***** comment *****/` showing up as bolded and italicized `comment *`.

## Use case

An API developer might want to impose strict type rules on reply result types at design time:

``` ts
interface IHello {
    msg: string
}

server.route([{
    method: 'GET',
    path: '/hello4',
    handler: function (request: Hapi.Request, reply: Hapi.IStrictReply<IHello>) {
        reply('Hello?') // Not ok, string is not IHello
        reply({ msg: 'Hello!' }) // Ok
    }
}]);
```
